import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Navigate.css"; // Import CSS file for styling

const Navigate = () => {
  const [menuUse, setMenuUse] = useState(true);
  const navigate = useNavigate();

  const menuBar = () => {
    setMenuUse(!menuUse);
  };

  const cart = () => {
    let user_id = localStorage.getItem("9ouenbcvgetywMhIOEJD") || "null";
    if (user_id === "null") {
      navigate("/login");
    } else {
      navigate("/cart");
    }
  };

  return (
    <>
      <div className="navbar">
        <img
          id="menuBar"
          src={
            menuUse
              ? "https://cdn-icons-png.flaticon.com/128/5036/5036960.png"
              : "https://cdn-icons-png.flaticon.com/128/10288/10288720.png"
          }
          alt="Menu"
          onClick={menuBar}
        />
        <h1 className="logo">shopper.com</h1>
        <nav id={`navigation${menuUse ? "true" : "false"}`}>
          <Link to="/">Home</Link>
          <Link to="/signup">Signup</Link>
          <Link to="/login">Login</Link>
          <img
            src="https://cdn-icons-png.flaticon.com/128/4290/4290722.png"
            alt="Cart"
            className="cart"
            onClick={cart}
          />
        </nav>
      </div>
      <div className="menus" id={menuUse ? "true" : "false"}>
        <Link to="/">
          <img
            src="https://cdn-icons-png.flaticon.com/128/25/25694.png"
            alt="Home"
          />
          <p>Home</p>
        </Link>
        <Link to="/signup">
          <img
            src="https://cdn-icons-png.flaticon.com/128/7542/7542128.png"
            alt="Signup"
          />
          <p>Signup</p>
        </Link>
        <Link to="/login">
          <img
            src="https://cdn-icons-png.flaticon.com/128/14575/14575259.png"
            alt="Login"
          />
          <p>Login</p>
        </Link>
        <Link to="/mobile">
          <img
            src="https://cdn-icons-png.flaticon.com/128/1551/1551353.png"
            alt="Mobile"
          />
          <p>Mobile</p>
        </Link>
        <Link to="/laptop">
          <img
            src="https://cdn-icons-png.flaticon.com/128/99/99488.png"
            alt="Laptop"
          />
          <p>Laptop</p>
        </Link>
        <Link to="/toys">
          <img
            src="https://cdn-icons-png.flaticon.com/128/3171/3171959.png"
            alt="Toys"
          />
          <p>Toys</p>
        </Link>
        <Link to="/cart">
          <img
            src="https://cdn-icons-png.flaticon.com/128/4290/4290722.png"
            alt="Cart"
          />
          <p>Cart</p>
        </Link>
        <a href="https://github.com/sivaprasath2004">
          <img
            src="https://cdn-icons-png.flaticon.com/128/4460/4460756.png"
            alt="Support"
          />
          <p>Support</p>
        </a>
      </div>
    </>
  );
};

export default Navigate;

